import { useState } from 'react';
import Logo from '../Components/Logo';

function Simulation(props) {

  function onEnd(){
    props.setIsRunning(false);
  }

  return (
    <div class="aligns-items-center justify-content-center card text-center w-50 position-absolute top-50 start-50 translate-middle">
    <div class="card-body">
      <div class="welcome">
        welcome to
      </div>
      <Logo/>
      <div class="startMusicText">
        stp[] playing music...
      </div>
      <button type="button" class="startButton btn btn-success" onClick={() => onEnd()}>Start!</button>
    </div>
  </div>
  );
}

export default Simulation;
